import style from "./FormLabelInput.module.css"

const FormLabelInput = (props) => {
  return <div className={style["form-label-input"]}>
      <label className={`${props.labelClassName}`}>{props.label} </label>
      <input type={props.inputype} className={`${props.inputClassName}`}></input>
  </div>;
};

export default FormLabelInput
